import React from 'react';
import { animate, motion } from 'framer-motion';
import { type } from '@testing-library/user-event/dist/type';
import Img from '../../Assets/Img.webp';

const parentVariants = {
    hidden: {
        y: "-100vw",
    },
    visible: {
        y: "0",
        transition: {
            duration: 1.5,
        },
    },
};

const childVariant = {
    hidden: {
        y: "100vw",
        opacity: 0,
        z: -100,
    },
    visible: {
        y: "0",
        opacity: 1,
        z: 0,
        transition: {
            type: "spring",
            delay: 5.5,
            duration: 2.5,
        },
    },
};

function RightSide() {
    return (
        <motion.div
            className="w-1/2 flex items-center justify-center bg-gradient-to-b from-blue-950 to to-blue-400"
            variants={parentVariants}
            initial="hidden"
            animate="visible"
            perspective={1000}
        >
            <motion.div
                className="flex flex-col bg-slate-300 rounded-xl w-2/4 h-2/4"
                variants={childVariant}
                initial="hidden"
                animate="visible"
            >
                {/* Add your content here */}
            </motion.div>
        </motion.div>
    );
}

export default RightSide;
